CREATE MATERIALIZED VIEW stream_query AS SELECT (t_0.c2 % (SMALLINT '1')) AS col_0, t_1.n_nationkey AS col_1, ((INTERVAL '604800') + t_0.c10) AS col_2 FROM alltypes2 AS t_0 RIGHT JOIN nation AS t_1 ON t_0.c9 = t_1.n_name AND (t_0.c2 <> (INT '555')) WHERE t_0.c1 GROUP BY t_0.c5, t_0.c3, t_0.c10, t_0.c15, t_0.c4, t_0.c2, t_0.c13, t_0.c7, t_0.c14, t_1.n_nationkey HAVING true;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT t_1.s_name AS col_0, t_0.c2 AS col_1 FROM alltypes1 AS t_0 RIGHT JOIN supplier AS t_1 ON t_0.c7 = t_1.s_acctbal AND t_0.c1 GROUP BY t_0.c1, t_0.c9, t_0.c2, t_1.s_phone, t_1.s_name, t_0.c16 HAVING t_0.c1;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT t_1.channel AS col_0, (coalesce(NULL, NULL, NULL, NULL, t_1.bidder, NULL, NULL, NULL, NULL, NULL)) AS col_1, t_0.date_time AS col_2, t_1.bidder AS col_3 FROM person AS t_0 LEFT JOIN bid AS t_1 ON t_0.city = t_1.url GROUP BY t_1.auction, t_0.state, t_1.extra, t_1.url, t_1.channel, t_1.bidder, t_0.date_time;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT (INTERVAL '0') AS col_0, t_2.l_discount AS col_1, t_2.l_shipinstruct AS col_2, t_2.l_orderkey AS col_3 FROM lineitem AS t_2 WHERE true GROUP BY t_2.l_discount, t_2.l_quantity, t_2.l_shipinstruct, t_2.l_tax, t_2.l_orderkey;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT sq_1.col_0 AS col_0, sq_1.col_0 AS col_1, sq_1.col_0 AS col_2, sq_1.col_0 AS col_3 FROM (SELECT DATE '2022-11-11' AS col_0 FROM tumble(person, person.date_time, INTERVAL '74') AS tumble_0 WHERE true GROUP BY tumble_0.id, tumble_0.email_address HAVING CAST((INT '-2147483648') AS BOOLEAN)) AS sq_1 WHERE (coalesce(NULL, NULL, true, NULL, NULL, NULL, NULL, NULL, NULL, NULL)) GROUP BY sq_1.col_0;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
